import styled from "styled-components";


const UserItemArea = styled.div`
  margin: 1rem 0;
  background: #8b005d;
  box-shadow: 0 2px 8px rgba(0, 0, 0, 0.26);
  color: white;
  padding: 1rem 2rem;
  cursor: pointer;
`

const UserItem = (props) => {
    return (
        <UserItemArea>
            {props.children}
        </UserItemArea>
    )
}

export default UserItem;
